import React from "react";

const UserName = ({ nombre, apellido }) => {
  return (
    <div className=" absolute top-5 right-5 flex font-[Helvetica Neue]">
      <h1 className=" m-2 text-2xl">{nombre}</h1>
      <h className=" m-2 text-2xl">{apellido}</h>
    </div>
  );
};

export default UserName;
